Celebrating International Women’s Day with purpose! 🌎  I was honored to receive an award for my work with Magenta House, empowering women through life and initiative.  We collaborated with Pushpanjali NGO, dedicated to supporting women who have faced abuse, to create a truly impactful event. The highlight was showcasing Nikita Tandon’s stunning summer collection in a fashion show, where I had the privilege of walking the runway. It was a day filled with inspiration, strength, and a shared commitment to empowering women. ❤️

